INSERT INTO `movie` VALUES ('1', '前任3：再见前任', '田雨生', '韩庚,郑恺,于文文,曾梦雪,罗米', '喜剧，爱情', '汉语普通话', '20171229', '120分钟', '33', '9.6', '剧情介绍：影片讲述了，一对好基友孟云（韩庚饰）和余飞（郑恺饰）跟女友都因为一点小事宣告分手，并且“拒绝挽回，死不认错”。两人在夜店、派对与交友软件上放飞人生第二春，大肆庆祝“黄金单身期”，从而引发了一系列好笑的故事。孟云与女友同甘共苦却难逃“五年之痒”，余飞与女友则棋逢敌手相爱相杀无绝期。然而现实的“打脸”却来得猝不及防：一对推拉纠结零往来，一对纠缠互怼全交代。两对恋人都将面对最终的选择：是再次相见？还是再也不见？', '1');
INSERT INTO `movie` VALUES ('2', '勇敢者游戏：决战丛林', '杰克·卡斯丹', '道恩·强森,凯文·哈特,杰克·布莱克,尼克·乔纳斯,凯伦·吉兰', '动作,冒险,喜剧', '英语', '20180112', '119分钟', '28', '7.2', '剧情介绍：影片主要讲述了性格迥异的四人，因为共同的课后留校聚在一起，又因让人“远离世界之路”的“勇敢者的游戏”而产生命运纠葛，共同打破次元壁，经历一场考验勇气智慧，接受成长磨炼的冒险的故事。', '1');
INSERT INTO `movie` VALUES ('3', '星球大战：最后的绝地武士', '莱恩·约翰逊', '黛茜·雷德利,约翰·波耶加,奥斯卡·伊萨克', '科幻,冒险', '英语', '20180105', '152分钟', '33', '7.5', '剧情介绍：《星球大战8》（Star Wars: Episode VIII）是动作、科幻、冒险电影《星球大战后传》系列的第2部，由莱恩·约翰逊执导，黛茜·雷德利、约翰·波耶加、格温多兰·克里斯蒂、奥斯卡·伊萨克联合主演。影片故事紧接《星球大战：原力觉醒》，讲述了遥远的银河系中恐怖政权“第一秩序”袭击新共和国首都之后的事。', '1');
INSERT INTO `movie` VALUES ('4', '无问西东', '李芳芳', '章子怡,黄晓明,王力宏,张震,陈楚生', '剧情,爱情,战争', '汉语普通话', '20180112', '138分钟', '30', '8.7', '剧情介绍：如果提前了解了你要面对的人生，你是否还会有勇气前来？吴岭澜、沈光耀、王敏佳、陈鹏、张果果，几个年轻人满怀诸多渴望，在四个非同凡响的时空中一路前行。他们在最好的年纪迎来了最残酷的考验，并成就了永不褪色的青春传奇。', '1');
INSERT INTO `movie` VALUES ('5', '卧底巨星', '谷德昭', '陈奕迅,李荣浩,李一桐', '喜剧,动作', '汉语普通话', '20180112', '98分钟', '28', '7.5', '剧情介绍：《卧底巨星》是由陈奕迅、李荣浩、李一桐主演，崔志佳、陈国坤、Chris Collins等加盟的一部集喜剧和动作于一身的电影。讲述了功夫巨星元豹被怀疑与泰国黑帮有染，警方设计铁柱前去卧底探查真相，没想到牵扯出一系列“不能说的秘密”。', '1');
INSERT INTO `movie` VALUES ('6', '喜洋洋与灰太狼之羊年喜羊羊', '黄伟明', '喜羊羊，懒羊羊，美羊羊，灰太狼，红太狼', '动漫，喜剧', '汉语普通话', '20150115', '120分钟', '29', '8.9', '青青草原上流传着一个远古时代“屠龙勇士”的传说，大家都十分向往。喜羊羊（祖晴', '2');
INSERT INTO `movie` VALUES ('7', '唐人街探案2', '陈思诚', '王宝强，刘昊然，肖央，刘承羽', '喜剧、探案、动作', '汉语普通话', '20180216', '140分钟', '35', '0', '秦风（刘昊然饰）接到唐仁（王宝强饰）的邀请来纽约参加其与阿香的婚礼。壕气逼人的唐仁迎接秦风，极尽招摇。岂料“婚礼”是唐仁为巨额奖金而参加的“世界名侦大赛”，比赛的内容是寻找唐人街教父七叔的孙子。', '0');
INSERT INTO `movie` VALUES ('8', '前任2：备胎反击战', '田雨生', '韩庚,郑恺,于文文,曾梦雪,罗米', '喜剧，爱情', '汉语普通话', '20171229', '120分钟', '33', '9.6', '剧情介绍：影片讲述了，一对好基友孟云（韩庚饰）和余飞（郑恺饰）跟女友都因为一点小事宣告分手，并且“拒绝挽回，死不认错”。两人在夜店、派对与交友软件上放飞人生第二春，大肆庆祝“黄金单身期”，从而引发了一系列好笑的故事。孟云与女友同甘共苦却难逃“五年之痒”，余飞与女友则棋逢敌手相爱相杀无绝期。然而现实的“打脸”却来得猝不及防：一对推拉纠结零往来，一对纠缠互怼全交代。两对恋人都将面对最终的选择：是再次相见？还是再也不见？', '0');
